import React, { useEffect, useState } from "react";
import DynamicTable from "components/Tables/table";
// react plugin used to create charts
import { NavLink } from "react-router-dom";
import { Nav } from "reactstrap";
import { Line, Pie } from "react-chartjs-2";
// reactstrap components
import {
  Card,
  CardHeader,
  CardBody,
  CardFooter,
  CardTitle,
  Row,
  Col,
  Table
} from "reactstrap";

function Analysis (){
    return (
        <div>
            <Card>
            <Nav>
                <Row>
                <NavLink to="/admin/analysis/portfolio">
                    <p>Portfolio Analysis</p>
                </NavLink>
                </Row>
                <Row>
                <NavLink to="/admin/analysis/stock">
                    <p>Stock Analysis</p>
                </NavLink>
                </Row>
                <Row>
                <NavLink to="/admin/analysis/option">
                    <p>Option Analysis</p>
                </NavLink>
                </Row>
            </Nav>
            </Card>
        </div>
    );
}

export default Analysis
